import React, {Component} from 'react'

function MenuButton(props) {
	const active = 'inline-block rounded py-1 px-3';
	const nonActive = 'inline-block rounded py-1 px-3 text-neutral-50';

	return (
		<a className={nonActive} href={props.href}>
			{props.label}
		</a>
	);
}

class Header extends Component {
	render() {
		return (
			<nav className='flex items-center justify-between flex-wrap p-6 bg-slate-700'>
				<div>Logo</div>

				<ul className='flex'>
					<li className='mr-3'><MenuButton href='#' label='Home' /></li>
					<li className='mr-3'><MenuButton href='#' label='Tasks' /></li>
					<li className='mr-3'><MenuButton href='#' label='Logout' /></li>
				</ul>
			</nav>
		);
	}
}

export default Header;
